create table interactives_spawns_skills
(
    Id                 int auto_increment
        primary key,
    InteractiveSpawnId int not null,
    SkillId            int not null
)
    engine = MyISAM
    charset = utf8;

create index InteractiveSpawnId
    on interactives_spawns_skills (InteractiveSpawnId);

create index InteractiveSpawnId_2
    on interactives_spawns_skills (InteractiveSpawnId);

